datosEmpleoCargoComision.funcionPrincipal:
-	COADYUVAR CON LA UNIDAD DE SEGUIMIENTO EN LA REVISIÓN DE LOS ASUNTOS QUE LE SEAN TURNADOS POR SUS SUPERIORES JERÁRQUICOS;

-	COADYUVAR CON LA REVISIÓN DE LOS ANÁLISIS DERIVADOS DE LAS OBSERVACIONES Y/O RECOMENDACIONES DETERMINADAS EN LAS AUDITORIAS RECIBIDAS EN LA UNIDAD;

-	EMITIR A SOLICITUD DE SUS SUPERIORES JERÁRQUICOS, OPINIONES JURÍDICAS, PROYECTOS DE ELABORACIÓN DE INSTRUMENTOS JURÍDICOS O CONSULTAS QUE SE LE SOLICITEN Y QUE SE REALICEN EN EL ÁMBITO DE COMPETENCIA EN LA UNIDAD DE SEGUIMIENTO;

-	COADYUVAR CON LOS TITULARES DE LOS DEPARTAMENTOS DE LA UNIDAD DE SEGUIMIENTO EN LA INSTAURACIÓN DEL ACTA ADMINISTRATIVA DE COMPARECENCIA A QUE REFIERE EL ARTÍCULO 47 FRACCIÓN III DEL REGLAMENTO INTERIOR DEL ÓRGANO SUPERIOR DE FISCALIZACIÓN DEL ESTADO DE MÉXICO; ASÍ COMO DE AQUELLAS ACTAS QUE CON MOTIVO DE SUS FUNCIONES SE LLEVEN A CABO;

-	VALIDAR AQUELLOS INSTRUMENTOS TÉCNICO–JURÍDICOS REALIZADOS EN EL ÁMBITO DE SUS FUNCIONES Y QUE DEBAN SER SOMETIDOS A LA FIRMA DEL TITULAR DE LA UNIDAD;

-	APOYAR A LOS SUPERIORES JERÁRQUICOS, EN LA ATENCIÓN A LAS ENTIDADES FISCALIZADAS QUE ASÍ LO SOLICITEN, REALIZANDO PREVIAMENTE EL FORMATO DE ATENCIÓN A SERVIDORES PÚBLICOS CORRESPONDIENTE;

-	UTILIZAR EN LOS INSTRUMENTOS JURÍDICOS QUE EMITA Y SUSCRIBA, LA HOJA MEMEBRETADA OFICIAL, ASIGNÁNDOLE EL NÚMERO DE OFICIO O MEMORÁNDUM QUE CORRESPONDA, PREVIA AUTORIZACIÓN DE SU SUPERIOR JERÁRQUICO;

-	REVISAR A DIARIO EN LAS PÁGINAS OFICIALES LAS PUBLICACIONES ESTATALES Y FEDERALES QUE EN MATERIA NORMATIVA O ADMINISTRATIVA CONCERNIENTE A LA UNIDAD DE SEGUIMIENTO SE PUBLIQUEN EN EL PERIÓDICO OFICIAL “GACETA DE GOBIERNO” Y DIARIO OFICIAL DE LA FEDERACIÓN Y, HACERLO DEL CONOCIMIENTO AL ENCARGADO DE NOTIFICARLO A OS SUPERIORES JERÁRQUICOS. CON INDEPENDENCIA DE LO ANTERIOR, TIENE LA RESPONSABILIDAD DE REALIZAR UN REPORTE DIARIO DE LAS PUBLICACIONES EMITIDAS;  

-	REALIZAR LAS DEMÁS FUNCIONES INHERENTES AL ÁREA DE SU COMPETENCIA, LAS QUE SEÑALEN LOS MANUALES DE PROCEDIMIENTOS QUE EXPIDA EL ÓRGANO SUPERIOR, LAS DISPOSICIONES JURÍDICAS APLICABLES Y LAS QUE ASIGNE EL SUPERIOR JERÁRQUICO;
